color: '#4B9ED6', // color of indicator and labels\n                // background box around indicator\n                // hideBezel will override this if true\n                backgroundColor: 'yellow',\n                hideBezel: true, // default false, can hide the surrounding bezel\n                // view: UIView // Target view to show on top of (Defaults to entire window)\n                //  mode: // see iOS specific options below\n            },\n        };\n        return options;\n    }\n    /**\n     * Show activity loader.\n     */\n    show() {\n        try {\n            this._loader.show(this.getOptions());\n        } catch (e) {\n            console.log('Error while showing lodingindicator. ' + e);\n        }\n    }\n    /**\n     * Hide activity loader.\n     */\n    hide() {\n        this._loader.hide();\n    }\n}\n\n    \n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/AppComponent.html":{"url":"components/AppComponent.html","title":"component - AppComponent","body":"\n                   \n\n\n\n\n\n  Components\n  AppComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    app/app.component.ts\n\n\n    \n        Description\n    \n    \n        This is the application component layout \nwhere all other component(s) will be used.\n\n    \n\n\n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                ns-app\n            \n\n\n\n\n            \n                templateUrl\n                app.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        import { Component } from '@angular/core';\nimport { CameraPlus } from '@nstudio/nativescript-camera-plus';\nimport { registerElement } from 'nativescri